import {  useSelector } from "react-redux";


import './pokemon.css';
import PokemonCard from "./PokemonCard";


export function PokemonGrid(){
    
    const pokemones=useSelector(store=>store.pokemons)
   const pokemon=pokemones.map(e=>e)
   console.log(pokemon)
    
    
   

    return(
        <div className="box">   
           
            <ul className="box">
                {
                    pokemon.map((i) => <PokemonCard 
                    src={i.image} 
                    name={i.name}
                    tipo={i.tipo}
                    image={i.imag}/> )
                            
                }
            </ul>
        </div>
    );
};
